Conor Oberst [2009] One Of My Kind:  The Story Of The Mystic Valley Band [MP4-720p]


One of My Kind is a 2009 documentary filmed about Conor Oberst and the Mystic Valley Band.  It documents their tour, life in Mexico, and the recording of their new album, &quot;Outer South.&quot;  This documentary was provided for free, in hopes that the viewers would donate to one of the numerous charities on the sponsoring website. &lt;a href=&quot;
